import React from 'react';


const FaceRecognition = () => {
    return (
        <div className='center'>
            <img src={'https://images.unsplash.com/photo-1554151228-14d9def656e4?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8Mnx8ZmFjZXxlbnwwfHwwfHw%3D&w=1000&q=80'}></img>
            
        
        </div>
    );
}

export default FaceRecognition;
